import React from "react"
import { Button, Container } from "react-bootstrap";

const Admin = (props) => {
  return (
    <Container className="d-flex flex-column">
      <Button variant="outline" className="mt-2">Добавить тип</Button>
      <Button variant="outline" className="mt-2">Добавить бренд</Button>
      <Button variant="outline" className="mt-2">Добавить вещь</Button>
    </Container>
  )
};

export default Admin;
